  false,\n\t\"url\": null,\n\t\"notes\": \"Bird species and population data, and related
  environmental data were collected from a transect following the coast of Antarctica.
  Data are contained in three sequential files: ANT 283, ANT 383 and ANT 483; data
  were originally recorded in EBCDIC. Five record types are included: location, environmental
  (wind, clouds, pressure, salinity), sea ice coverage, a comment record, and bird
  census record (age, species, sex, color, plumage, molt, behavior, habitat, and count).
  These data were collected by George L. Hunt at the University of California, Irvine.
  The documentation includes a map of the transect studied and a detailed description
  of the record format.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
